import React from "react";
function Animal(type, name, sound) {
    this.type = type;
    this.name = name;
    this.sound = sound;
    this.say = function(){
    console.log(this.sound);
    }
}

export default function test(){
const dog = new Animal('개', '해피', '멍멍');
const cat = new Animal('고양이', '여름', '야~옹');

dog.say();
cat.say();
}
